import React from "react";
import Wrapper from "../Wrapper/";
import Thumbnail from "../Thumbnail";
import projectImg from "../../Assets/coming-soon.jpeg";

function Portfolio() {
  const projects = [
    {
      name: "Project 1",
      thumbnail: "https://via.placeholder.com/300",
      url: "https://github.com/kennyqng"
    },
    {
      name: "Project 2",
      thumbnail: "./Assets/coming-soon.jpeg",
      url: "https://github.com/kennyqng/"
    },
    {
      name: "Project 3",
      thumbnail: "./Assets/coming-soon.jpeg",
      url: "https://github.com/kennyqng/"
    }
  ];
  return (
    <Wrapper>
      {projects.map( project => (
        <Thumbnail
          url={project.url}
          image={project.thumbnail}
          name={project.name}
        />
      )
      )}
    </Wrapper>
  );
}

export default Portfolio;
